import React from 'react';
import ButtonStyle from '../../Css/Components/HomeComponent/Buttons.module.css';


const Buttons = (props) => {
	return (
		<div className={ButtonStyle.Mid}>
			
			<button className={`${ButtonStyle.MyBtn}`}>
				
				{props.name}
				
				</button>
		</div>
	);

}

export default Buttons;
